<p style="margin-top:8px;margin-bottom:0px"><font style="font-family:arial" size="2">In addition to our consolidated financial results, our management regularly reviews a number of operating and financial metrics, including our instrument installed
base and consumable pull-through per instrument, to evaluate our business, measure our performance, identify trends affecting our business, formulate financial projections and make strategic decisions. We define the instrument installed base as the
cumulative number of instruments sold since inception and define consumable pull-through per instrument as the total consumables revenue in the given quarter divided by the average instrument installed base during that quarter. We believe that these
metrics are representative of our current business; however, these metrics may not accurately reflect all aspects of our business and we anticipate that these metrics may change or may be substituted for additional or different metrics as our
business grows and as we introduce new products. For example, we expect that our expansion into new markets and adoption by new customers who may not have the same financial resources to devote to consumable purchases as our existing customer base
could adversely impact our pull-through figures. These metrics also do not accurately reflect information relating to customers who purchase consumables but do not own an instrument, whom we refer to as �halo users�. Halo users and the
future introduction of consumables that may not use instruments, such as our recently announced Visium solution, or instruments that are expected to use a greater amount of consumables, such as our Chromium Connect instrument, could reduce the
utility of our consumable pull-through per instrument metric and make it difficult to compare such figures over time. Moreover, we expect some of our halo users to purchase instruments of their own which would decrease the consumables sold per
instrument and therefore decrease our annual consumable pull-through per instrument. Though we expect the introduction of enhanced features and additional solutions on our Chromium instrument to increase consumable pull-through per instrument and to
offset this decline, there are no assurances we will be successful in doing so. If our management fails to review other relevant information or change or substitute the key business metrics they review as our business grows and we introduce new
products, their ability to accurately formulate financial projections and make strategic decisions may be compromised and our business, financial results and future growth prospects may be adversely impacted. </font></p>
